// ##############################
// // // Tasks for TasksCard - see Dashboard view
// #############################

var tasks = [
  'Sign contract with Beverley client',
  "Assessing losses and gains from the last deal",
  "Create 4 Invisible user experiences"
];
var followUp = [
  'Sign contract for "What are conference organizers afraid of?"'
];
var meetings = [
  "John - monthly performance review - 10 AM today",
  "Indiana - talk about design changes - 11 AM tomorrow",
  "Tom - prepare for the cultural night - 1 PM day after tomorrow"
];

module.exports = {
  // these 3 are used to create the tasks lists in TasksCard - Dashboard view
  tasks,
  followUp,
  meetings 
};
